function getDirector(division){
	var gr = new GlideRecord('x_exte_cml_request_cml_approvers');
	gr.addQuery('division',division);
	gr.query();
	var dir = '';
	while(gr.next()){
		dir = gr.getValue('person');
	}
	
	return dir;
}

