current.assigned_to = getLead();
setApprovedOnTest();
current.update();

function setApprovedOnTest(){
	var gt = new GlideRecord('x_exte_cml_request_cml_request_tests');
	workflow.debug('HERE  '+current.sys_id);
	gt.addQuery('request_number',current.sys_id);
	gt.query();
	
	while(gt.next()){
		workflow.debug('HERE IN LOOP '+current.sys_id);
		gt.setValue('approved','true');
		gt.update();
	}
	
}

function getLead(){
	var ag = current.assignment_group;
	workflow.debug('assignemnt group '+ag);
	var gr = new GlideRecord('sys_user_group');
	gr.get(ag);
	
	//while(gr.next()){
			workflow.debug('Lead - '+gr.manager);
	//}
	
	return gr.manager;
	
	
	
	
}

